async function main() {
  const JWKS = artifacts.require("JWKS");
  const jwks = await JWKS.new();
  await jwks.addKey(
    "1dc0f172e8d6ef382d6d3a231f6c197dd68ce5ef",
    ""
  )
  await jwks.addKey(
    "d9740a70b0972dccf75fa88bc529bd16a30573bd",
    ""
  )
  console.error("JWKS deployed")
  console.log(jwks.address);
}

module.exports = function(cb) {
  main().then(() => cb()).catch(err => cb(err));
}